import React, { Component } from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  .iphone-body{
    text-align: center;
    height: 159px;
    width: 78px;
    background-color: green;
  }
`;

class Iphone extends Component{
  render() {
    return (
      <Wrapper>
        <div className="iphone-body">
test  
        </div>  
      </Wrapper>
    );
  }
}

export { Iphone };
